import React from 'react';

import './TimeLine.css'

const TimeLine = () => {
  return (
    <div className="timeline__main-container">
      <h1>Timeline</h1>
      <p>I've started my journey back in 2014 at university. Finished with little experience and faced the "minimum 3+ years of real life experience".</p>
    </div>
  )
}

export default TimeLine
